using namespace std;
void swap(int &a,int &b){
    int tmp=a;
    a=b;b=tmp;
}
void qsort(int a[], int s,int e){
    int i=s,j=e,q=a[(s+e)>>1];
    while (i<=j){
        while (a[i]<q) i++;
        while (q<a[j]) j--;
        if (i<=j) {
            cout<<i <<"  "<< j <<endl;
            cout<<a[i]<<"  "<<a[j]<<endl;
            cout<<a[i++]<<"  "<<a[j--]<<endl;
            swap(a[i++],a[j--]);
           } 
    }
    if (s<j) qsort(a,s,j);
    if (i<e) qsort(a,i,e);
}
